import { useState, useEffect } from "react";
import './App.css';
import { getBookings } from "./BookingService";

function App() {

  const [hotelBookings, setHotelBookings] = useState([])

  useEffect(() => {
    getBookings().then((allBookings) => {
      setHotelBookings(allBookings)
    })
  }, []);

  return (
    <div className="App">
      <h2>Hello World</h2>
      <h3>{hotelBookings}</h3>
    </div>
  );
}

export default App;
